<title>404 - NATIVET - Diagnostyka, leczenie, badanie drobiu.</title>
<meta name="description" content="Nasz gabinet Weterynaryjny miesci sie w Olsztynie, swoje dzialania wykonujemy na terenie calej polski. Zajmujemy sie chorobami drobiu oraz ptakow ozdobnych. Posiadamy wieloletnie doswiadczenie w diagnostyce, badaniu oraz leczeniu drobiu, co pozwala nam rowniez na profesjonalne dorzdztwo m.in. w zakresie zarzadzania stadem drobiu, bioasekuracji ferm, warunkow zootechnicznych. Zapraszamy do zapoznania sie z nasza oferta uslug oraz do kontaktu z naszymi lekarzami weterynarii."/>
